import 'package:freezed_annotation/freezed_annotation.dart';part 'top_products_model.freezed.dart';part 'top_products_model.g.dart';@freezedclass TopProductsModel with _$TopProductsModel {  @JsonSerializable(explicitToJson: true, fieldRename: FieldRename.snake)  const factory TopProductsModel(    bool? success,    String? message,    int? code,    ProductDatas? data,  ) = _TopProductsModel;  factory TopProductsModel.fromJson(Map<String, dynamic> json) =>      _$TopProductsModelFromJson(json);}@freezedclass ProductDatas with _$ProductDatas {  @JsonSerializable(explicitToJson: true, fieldRename: FieldRename.snake)  const factory ProductDatas(List<ProductItem>? data) = _ProductDatas;  factory ProductDatas.fromJson(Map<String, dynamic> json) =>      _$ProductDatasFromJson(json);}@freezedclass ProductItem with _$ProductItem {  @JsonSerializable(explicitToJson: true, fieldRename: FieldRename.snake)  const factory ProductItem(    int? id,    String? name,    String? image,    String? availability,    String? axiomMonthlyPrice,    int? salePrice,    int? oldPrice,    int? reviewsCount,    int? reviewsAverage,    int? allCount,    List<Stickers>? stickers,    List<dynamic>? saleMonths,  ) = _ProductItem;  factory ProductItem.fromJson(Map<String, dynamic> json) =>      _$ProductItemFromJson(json);}@freezedclass Stickers with _$Stickers {  @JsonSerializable(explicitToJson: true, fieldRename: FieldRename.snake)  const factory Stickers(    String? name,    String? backgroundColor,    String? textColor,    bool? isImage,    bool? showInCard,    dynamic image,  ) = _Stickers;  factory Stickers.fromJson(Map<String, dynamic> json) =>      _$StickersFromJson(json);}